import React from 'react';

function Jumbo () {
  return (
    <div className="container">
        <div class="jumbotron">
            <h1 class="display-4">(React) Google Book Search</h1>
            <h3 class="lead">Search for and Save books of interest.</h3>
            <hr class="my-4"></hr>
        </div>
    </div>
  )
}

export default Jumbo;
